@glowmuas x @makeupbygilly Master Class ✨

I wanted to take a moment to express my heartfelt gratitude to each and every one of you for making my master class on Sunday an incredible success. The energy and enthusiasm you brought to the class were truly remarkable. I am so grateful to @glowmuas for providing me with this opportunity to share my knowledge and expertise with such a dedicated group of individuals.

The class was nothing short of amazing, and it was all because of your enthusiasm, passion, and willingness to learn. Your eagerness to soak up every bit of information and your commitment to mastering the techniques we covered was truly inspiring.

I want you all to know that this master class would not have been possible without your trust, support, and participation. Your presence, questions, and engagement made the experience truly meaningful and memorable. It was an absolute pleasure to work with such talented individuals who share the same love and passion for the art of makeup.

Once again, I extend my heartfelt thanks to @reina.roxanne @devinchi__ and the entire @glowmuas team for the opportunity, and to each and every one of my students for making the master class an unforgettable experience. Your dedication and commitment to learning and growing as makeup artists is truly commendable, and I know you will all go on to achieve great things in your careers. Thank you to my amazing model @makeupbyhaylie_  For always being there when i need you. Thank you to my Best friend @devinchi__ for all your help during this event. I couldn’t have done it without you. 

I’d also like to thank all the amazing sponsors we had for this class. We could not express enough gratitude for your generosity and support. 

